const arrayNested = [
    {family:'Stark', famlilyMembers :['judy','mike','Ryan' ]},
    {family:'Nark', nums :['judy','mike','Ryan']},
];

const NestArray = () =>(
    <>
      {arrayNested.map((cof) => (
        <ul key={cof.family}>The Family name is: {cof.family} {cof.nums.map(num=><li>{num}</li>)}</ul>
      ))}
    </>
)

export default NestArray
